INSERT INTO `tqk_help` (`id`, `title`, `info`, `seo_title`, `seo_keys`, `seo_desc`, `last_time`) VALUES
(1, '关于我们', '<p style="padding-bottom:0px;widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;padding-left:0px;letter-spacing:normal;padding-right:0px;font:12px/30px Tahoma,Helvetica,Arial,宋体,sans-serif;word-wrap:break-word;white-space:normal;orphans:2;color:#5e5e5e;word-spacing:0px;padding-top:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;">\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<span style="font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;">尊敬的推客用户<br />\r\n<br />\r\n</span>\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<span style="font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;">&nbsp; &nbsp; &nbsp; 由于推券客提供的微信公众号服务器网址使用用户过多，微信要求必须进行第三方平台认证。<br />\r\n</span><br />\r\n因此我们做了以下调整：\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<br />\r\n1. 老的公众号服务器网址 到10月8号无法继续使用。<br />\r\n<br />\r\n2.&nbsp; 请登录推券客平台进入&nbsp; “站点设置 ” 获取新的公众号服务器网址 （注：此网址已经通过微信第三方平台认证）\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<br />\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		3.&nbsp; 取消 公众号直播网址 （注: 推券客CMS V1.8版本已经将“优惠直播”模块迁移到手机站，不再需要此直播网址支持，\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		所以你的网站后台直播配置中可以不用填写）<br />\r\n<br />\r\n<span style="color:#E53333;font-size:16px;">特别提醒：因推券客CMS是开源的程序，里面的逻辑架构技术人员很容易看明白。</span>\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<span style="color:#E53333;font-size:16px;">所以公众号</span><span style="color:#E53333;font-size:16px;">服务器网址和通行密钥请不要随便泄露，否则会对你的网站安全造成隐患。</span>\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<span style="color:#E53333;font-size:16px;"><br />\r\n</span>\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<span style="color:#E53333;font-size:16px;"><br />\r\n</span>\r\n	</p>\r\n	<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-size:14px;line-height:24px;color:#333333;font-family:&quot;white-space:normal;background-color:#FFFFFF;">\r\n		<span style="color:#E53333;font-size:16px;"><br />\r\n</span>\r\n	</p>\r\n</p>', '', '', '', 1507858298),
(2, '联系我们', '<p style="margin-top:0px;margin-bottom:0px;padding:0px;color:#5E5E5E;font-family:Tahoma,Helvetica,Arial,宋体,sans-serif;line-height:30px;white-space:normal;background-color:#FFFFFF;">\r\n	<br />\r\n</p>', '', '', '', 1488612868),
